import { useState, useCallback } from "react";
//import StudentMode from "../components/StudentMode";
import PortalPopup from "../components/PortalPopup";
import { useNavigate } from "react-router-dom";
import "./DASHBOARDCONTACTPARENT.css";

const DASHBOARDCONTACTPARENT = () => {
  const [isStudentModeOpen, setStudentModeOpen] = useState(false);
  const navigate = useNavigate();

  const onContactUsClick = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onGroupContainer1Click = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onProgressClick = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onGroupContainer2Click = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onCoursesClick = useCallback(() => {
    navigate("/22-dashboard-parent-courses");
  }, [navigate]);

  const onGroupContainer7Click = useCallback(() => {
    navigate("/22-dashboard-parent-courses");
  }, [navigate]);

  const onSettingsClick = useCallback(() => {
    navigate("/14-dashboard-parent-settings");
  }, [navigate]);

  const onGroupContainer9Click = useCallback(() => {
    navigate("/14-dashboard-parent-settings");
  }, [navigate]);

  const onGroupIcon1Click = useCallback(() => {
    navigate("/20-dashboard-home-paretnt");
  }, [navigate]);

  const openStudentMode = useCallback(() => {
    setStudentModeOpen(true);
  }, []);

  const closeStudentMode = useCallback(() => {
    setStudentModeOpen(false);
  }, []);

  return (
    <>
      <div className="dashboard-contact-parent">
        <div className="group-parent23">
          <div className="group-parent24">
            <div className="group-parent24">
              <div className="group-child36" />
              <div className="contact-us-parent10">
                <button className="contact-us14" onClick={onContactUsClick}>
                  <div
                    className="contact-us-inner4"
                    onClick={onGroupContainer1Click}
                  >
                    <div className="contact-us-parent11">
                      <div className="contact-us15">Contact Us</div>
                      <img className="vector-icon47" alt="" src="/vector.svg" />
                    </div>
                  </div>
                </button>
                <button className="progress14" onClick={onProgressClick}>
                  <div
                    className="vector-parent24"
                    onClick={onGroupContainer2Click}
                  >
                    <img className="vector-icon48" alt="" src="/vector1.svg" />
                    <div className="progress15">Progress</div>
                  </div>
                </button>
                <div className="vector-parent25">
                  <img className="vector-icon49" alt="" src="/vector2.svg" />
                  <div className="parent-mode9">Parent Mode</div>
                </div>
                <div className="home-parent6">
                  <div className="home10">Home</div>
                  <img className="vector-icon50" alt="" src="/vector3.svg" />
                </div>
              </div>
            </div>
            <button className="courses17" onClick={onCoursesClick}>
              <div className="vector-parent26" onClick={onGroupContainer7Click}>
                <img className="vector-icon51" alt="" src="/vector4.svg" />
                <div className="courses18">Courses</div>
              </div>
            </button>
          </div>
          <button className="settings18" onClick={onSettingsClick}>
            <div className="group-parent25" onClick={onGroupContainer9Click}>
              <img className="group-icon9" alt="" src="/group.svg" />
              <div className="settings19">Settings</div>
            </div>
          </button>
        </div>
        <div className="dashboard-contact-parent-child" />
        <div className="dashboard-contact-parent-item" />
        <img
          className="microsoftteams-image-1-15"
          alt=""
          src="/microsoftteamsimage-1-1@2x.png"
        />
        <div className="rectangle-parent26">
          <div className="group-child37" />
          <div className="group-child38" />
          <img className="group-child39" alt="" src="/ellipse-12@2x.png" />
          <div className="marie-antoinette-cruz-container">
            <p className="marie-antoinette-cruz">Marie ANTOINETTE CRUZ</p>
          </div>
        </div>
        <div className="rectangle-parent26">
          <div className="group-child37" />
          <div className="group-child38" />
          <img className="group-child39" alt="" src="/ellipse-12@2x.png" />
          <div className="marie-antoinette-cruz-container">
            <p className="marie-antoinette-cruz">Marie ANTOINETTE CRUZ</p>
          </div>
        </div>
        <img className="vector-icon52" alt="" src="/vector5.svg" />
        <img
          className="dashboard-contact-parent-inner"
          alt=""
          src="/group-78.svg"
          onClick={onGroupIcon1Click}
        />
        <div className="dashboard-contact-parent-child1" />
        <div className="dashboard-contact-parent-child2" />
        <div className="email-adress">Email Adress:</div>
        <div className="dashboard-contact-parent-child3" />
        <div className="contact">Contact:</div>
        <div className="dashboard-contact-parent-child4" />
        <div className="address">Address:</div>
        <a
          className="marieantoinettecruzyahoocom"
          href="mailto:MarieAntoinetteCruz@yahoo.com"
          target="_blank"
        >
          MarieAntoinetteCruz@yahoo.com
        </a>
        <div className="div9">08346723423</div>
        <div className="springtree-cebu-city">SpringTree Cebu City</div>
        <img className="vector-icon53" alt="" src="/vector10.svg" />
        <img className="vector-icon54" alt="" src="/vector10.svg" />
        <img className="vector-icon55" alt="" src="/vector10.svg" />
        <button className="rectangle-parent28" onClick={openStudentMode}>
          <div className="group-child43" />
          <img className="group-child44" alt="" src="/ellipse-5.svg" />
        </button>
      </div>
      {isStudentModeOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeStudentMode}
        >
          <StudentMode onClose={closeStudentMode} />
        </PortalPopup>
      )}
    </>
  );
};

export default DASHBOARDCONTACTPARENT;
